import { HttpClient, HttpResponse } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { IrmCoeur } from '../models/IrmCoeur';

@Injectable({
  providedIn: 'root'
})
export class IrmcoeurService {

  private apiUrl = 'https://localhost:7129/api/Irmcoeurs';

  constructor(private http: HttpClient) { }
  addIrm(IrmCoeur: IrmCoeur): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', IrmCoeur);

    return this.http.post<any>(`${this.apiUrl}/addIrm`, IrmCoeur, { observe: 'response' });
  }}
